def assembly():
    a1 = mdb.models['Model-1'].rootAssembly
    p = mdb.models['Model-1'].parts['Sheet']
    a1.Instance(name='Sheet-1', part=p, dependent=ON)
    p = mdb.models['Model-1'].parts['Support_bottom']
    a1.Instance(name='Support_bottom-1', part=p, dependent=ON)
    p = mdb.models['Model-1'].parts['Indenter']
    a1.Instance(name='Indenter-1', part=p, dependent=ON)

    a1 = mdb.models['Model-1'].rootAssembly
    a1.translate(instanceList=('Sheet-1',), vector=(0.0, -(60.0 + sheet_thickness), 0.0))

    a1 = mdb.models['Model-1'].rootAssembly
    a1.translate(instanceList=('Support_bottom-1',), vector=(0.0, 0.0, 50.0))

    a1 = mdb.models['Model-1'].rootAssembly
    a1.rotate(instanceList=('Indenter-1',), axisPoint=(0.0, 0.0, 0.0),
              axisDirection=(0.0, 1.0, 0.0), angle=-90.0)

    a = mdb.models['Model-1'].rootAssembly
    a = mdb.models['Model-1'].rootAssembly
    a.DatumCsysByDefault(CARTESIAN)
    p = mdb.models['Model-1'].parts['Support_top']
    a.Instance(name='Support_top-1', part=p, dependent=ON)

    a = mdb.models['Model-1'].rootAssembly
    a.translate(instanceList=('Support_top-1',), vector=(0.0, 0.0, 0.0))

    a = mdb.models['Model-1'].rootAssembly
    a.translate(instanceList=('Support_top-1',), vector=(0.0, 0.0, 70.0))

    a = mdb.models['Model-1'].rootAssembly
    session.viewports['Viewport: 1'].setValues(displayedObject=a)


def step_setup():
    # absolute zero
    mdb.models['Model-1'].setValues(absoluteZero=-273.15)

    # Symetry BCs
    a = mdb.models['Model-1'].rootAssembly
    region = a.instances['Indenter-1'].sets['Set-Indenter-Zmin']
    mdb.models['Model-1'].ZsymmBC(name='BC-indentZ', createStepName='Initial',
                                  region=region, localCsys=None)
    a = mdb.models['Model-1'].rootAssembly
    region = a.instances['Indenter-1'].sets['Set-Indenter-Xmin']
    mdb.models['Model-1'].XsymmBC(name='BC-indentX', createStepName='Initial',
                                  region=region, localCsys=None)
    a = mdb.models['Model-1'].rootAssembly
    region = a.instances['Sheet-1'].sets['Set-Sheet-Zmin']
    mdb.models['Model-1'].ZsymmBC(name='BC-SheetZ', createStepName='Initial',
                                  region=region, localCsys=None)
    a = mdb.models['Model-1'].rootAssembly
    region = a.instances['Sheet-1'].sets['Set-Sheet-Xmin']
    mdb.models['Model-1'].XsymmBC(name='BC-SheetX', createStepName='Initial',
                                  region=region, localCsys=None)

    # Rigid BCs

    a = mdb.models['Model-1'].rootAssembly
    region = a.instances['Support_bottom-1'].sets['Set-BotSup_RP']
    mdb.models['Model-1'].EncastreBC(name='BC-BotSup-Encastre',
                                     createStepName='Initial', region=region, localCsys=None)
    a = mdb.models['Model-1'].rootAssembly
    region = a.instances['Support_top-1'].sets['Set-TopSup-RP']
    mdb.models['Model-1'].EncastreBC(name='BC-TopSup-Encastre',
                                     createStepName='Initial', region=region, localCsys=None)

    # General Contacts

    mdb.models['Model-1'].ContactProperty('IntProp-gen')
    mdb.models['Model-1'].interactionProperties['IntProp-gen'].TangentialBehavior(
        formulation=FRICTIONLESS)
    mdb.models['Model-1'].interactionProperties['IntProp-gen'].NormalBehavior(
        pressureOverclosure=HARD, allowSeparation=ON,
        constraintEnforcementMethod=DEFAULT)
    mdb.models['Model-1'].ContactExp(name='Int-gen-contact',
                                     createStepName='Initial')
    mdb.models['Model-1'].interactions['Int-gen-contact'].includedPairs.setValuesInStep(
        stepName='Initial', useAllstar=ON)
    mdb.models['Model-1'].interactions['Int-gen-contact'].contactPropertyAssignments.appendInStep(
        stepName='Initial', assignments=((GLOBAL, SELF, 'IntProp-gen'),))

    # Predefined fields
    a = mdb.models['Model-1'].rootAssembly
    region = a.instances['Indenter-1'].sets['Set-Indenter']
    mdb.models['Model-1'].Velocity(name='Predefined Field-indent-Vel',
                                   region=region, field='', distributionType=MAGNITUDE,
                                   velocity2=-10000.0, omega=0.0)
    a = mdb.models['Model-1'].rootAssembly
    region = a.instances['Indenter-1'].sets['Set-Indenter']
    mdb.models['Model-1'].Temperature(name='Predefined Field-indent-Temp',
                                      createStepName='Initial', region=region, distributionType=UNIFORM,
                                      crossSectionDistribution=CONSTANT_THROUGH_THICKNESS, magnitudes=(25.0,
                                                                                                       ))
    a = mdb.models['Model-1'].rootAssembly
    region = a.instances['Sheet-1'].sets['Set-Sheet']
    mdb.models['Model-1'].Temperature(name='Predefined Field-Sheet-Temp',
                                      createStepName='Initial', region=region, distributionType=UNIFORM,
                                      crossSectionDistribution=CONSTANT_THROUGH_THICKNESS, magnitudes=(25.0,
                                                                                                       ))

    # Step 1
    mdb.models['Model-1'].ExplicitDynamicsStep(name='Step-1', previous='Initial', timePeriod=0.003, adiabatic=ON,
                                               improvedDtMethod=ON)

    # Field outputs
    mdb.models['Model-1'].fieldOutputRequests['F-Output-1'].setValues(
        numIntervals=30)
    mdb.models['Model-1'].fieldOutputRequests['F-Output-1'].setValues(variables=(
        'S', 'SVAVG', 'TRIAX', 'LODE', 'PE', 'PEVAVG', 'PEEQ', 'PEEQVAVG',
        'LE', 'U', 'V', 'A', 'RF', 'CSTRESS', 'EVF'))



